// src/components/SpaceMarineList.js
import React, { useState } from 'react';

export  function Main() {
    const [response, setResponse] = useState('');

    const handleSubmit = async (event) => {
        event.preventDefault();
        const sort = event.target.sort.value;
        const order = event.target.order.value;
        const filter = event.target.filter.value;
        const page = event.target.page.value;
        const pageSize = event.target.pageSize.value;

        let url = `https://localhost:8083/api/v1/space-marine?sort=${sort}&order=${order}&page=${page}&pageSize=${pageSize}`;
        if (filter) {
            filter.split(',').forEach(f => {
                url += `&filter=${f.trim()}`;
            });
        }

        try {
            const res = await fetch(url);
            const data = await res.text();
            setResponse(data);
        } catch (err) {
            setResponse('Error: ' + err.message);
        }
    };

    return (
        <section>
            <h2>Get SpaceMarine List (GET /space-marine)</h2>
            <form onSubmit={handleSubmit}>
                {/* Form fields here */}
                <button type="submit">Send GET request</button>
            </form>
            <div className="response">{response}</div>
        </section>
    );
}
